import React from "react";
import "./Listings.css"; // We'll create the CSS file next
import searchIcon from "../../Assets/NavBarIcons/search 1.svg";

const Listings = () => {
  return (
    <div className="listings">
      <div className="Search-container">
        <div className="title">Listings</div>
        <div className="searchbar">
          <input type="text" className="searchInput" name="search" placeholder="Search for things ..." />
          <label for="search" className="searchIcon">
            <img className="searchIcon" src={searchIcon}></img>
            <div className="breakLine"></div>

          </label>
        </div>
        <div className="add-prdct-btn">
          <button className="btn">Add product +</button>
        </div>
      </div>

      <div className="table-container"></div>
    </div>
  );
};

export default Listings;
